#include "dog.h"
#include <stdlib.h>
#include <stdio.h>
/**
 * new_dog - function pointer that creates a new dog
 * @name: name of new dog
 * @age: age of dog
 * @owner: name of owner
 * Return: returns null if function fa char *owner)
 */
dog_t *new_dog(char *name, float age, char *owner)
{
	if (new_dog != NULL)
	{
		new_dog->name = name;
		new_dog->age = age;
		new_dog->owner = owner;
	}
	else
		return (NULL);
}
